import React from 'react';
import {Link} from 'react-router-dom';
import NavBar from './NavBar.js';
class Menu extends React.Component{
    render(){
        return(
            <div>
                <NavBar/>
                <div className="menu-item"><button>Home</button></div>
                <div className="menu-item"><button>Sign up</button></div>
                <div><button>Log in</button></div>
                <div><button>Your Profile</button></div>      
            </div>
        )
    }
}
export default Menu;
